import "../index.css";
import { createTheme } from "@mui/material/styles";

const theme = createTheme({
  typography: {
    fontFamily: "Noto SansKR, Noto Sans",
  },
  components: {
    MuiCssBaseline: {
      styleOverrides: {
        // "@global": {
        //   "@font-face": [notoSansKR, notoSans],
        // },
      },
    },
  },
});

export default theme;
